INSERT INTO `Sentence` VALUES (1,'बीजेपी सांसद शत्रुघ्न सिन्हा ने शनिवार रात करीब 10 बजे सीएम नीतीश कुमार से उनके सरकारी आवास पर मुलाकात की .'),(2,'सिन्हा और कुमार के बीच मुलाकात मुख्यमंत्री आवास में हुई .'),(3,'मुंबई हमले के दोषी याकूब मेमन की फांसी के विरोध में अब बॉलीवुड के सुपरस्टार सलमान खान भी आ गए हैं ।'),(4,'बॉलीवुड के सुपरस्टार सलमान खान ने खुले तौर पर याकूब मेमन को फांसी दिए जाने का विरोध किया है ।'),(5,'बीती रात सलमान खान ने 51 मिनट में एक के बाद एक 14 ट्विट किये '),(6,'सलमान ने शनिवार देर कई सारे ट्वीट करके याकूब का समर्थन किया ।'),(7,'दिल्ली के पटियाला कोर्ट ने क्रिकेटर एस श्रीसंत '),(8,'आईपीएल स्पॉट फिक्सिंग में दिल्ली की मकोका कोर्ट ने अपना फैसला सुनाते हुए एस श्रीसंत '),(9,'ये मामला 2013 में उस वक़्त शुरू हुआ जब दिल्ली पुलिस ने स्पॉट फ़िक्सिंग के आरोप में श्रीसंत '),(10,'NULL गौरतलब है कि तीनों ही खिलाड़ियों पर 2013 में स्पॉट फिक्सिंग के मामले में गिरफ्तार किया गया था ।'),(11,'पारंपरिक लिबास में पहुंचीं तो नहीं दे पाईं मेडिकल की परीक्षा ।'),(12,'पारंपरिक लिबास में पहुंचीं नन नहीं दे पाईं पीएमटी ।'),(13,'जापान की राजधानी टोक्यो के रिहायशी इलाके में रविवार को एक छोटा विमान दुर्घटनाग्रस्त हो गया ।'),(14,'टोक्यो में रिहायशी इलाके में क्रैश होकर गिरा छोटा विमान ।'),(15,'मिस्र के उत्तरी सिनाई में सेना की छापेमारी में 12 चरमपंथियों की मौत'),(16,'मिस्र की नील नदी में गत बुधवार को हुई नौका दुर्घटना के बाद नदी से 15 और शव निकाले ।'),(17,'स्वच्छ भारत अभियान भारत सरकार द्वारा चलायी गयी एक स्वच्छता मिशन है ।'),(18,'स्वच्छ भारत अभियान एक राष्ट्रव्यापी सफाई अभियान के रूप में प्रधानमंत्री नरेंद्र मोदी द्वारा शुरू की गई एक स्वच्छता अभियान है ।'),(19,'स्वच्छ भारत मिशन या स्वच्छ भारत अभियान भारत सरकार द्वारा चलाया गया एक विशाल जन आंदोलन है जोकि पूरे भारत में सफाई को बढ़ावा देता है ।'),(20,'राष्ट्र पिता महात्मा गांधी ने भारत को एक स्वच्छ भारत बनाने का सपना देखा और इसके लिए हमेशा कठिन प्रयास किये .'),(21,'राष्ट्र पिता महात्मा गांधी ने भारत को एक स्वच्छ भारत बनाने का सपना देखा .'),(22,'भारत को एक स्वच्छ देश बनाना राष्ट्र पिता महात्मा गांधी का एक सपना था .'),(23,'महात्मा ग